import './ImageMin.css'
function ImageMin(props) {
    return (
        <div class="post-card">
            <a href="">
            <img src={props.url} />
            <button className='btn btn-primary'>Like</button>
            <button className='btn btn-danger'>Delete</button>
            </a>
        </div>
    )
}
export default ImageMin;
